  ,subregion   VARCHAR(35) NOT NULL
  ,landAreaKm  NUMERIC(9,1) NOT NULL
  ,density     NUMERIC(9,4) NOT NULL
  ,densityMi   NUMERIC(10,4) NOT NULL
  ,Pop_Rank    INTEGER  NOT NULL
  ,totAll      INTEGER  NOT NULL
  ,totBrz      INTEGER  NOT NULL
  ,totSilv     INTEGER  NOT NULL
  ,totGold     INTEGER  NOT NULL
